import React from 'react';
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavbarBrand from "react-bootstrap/NavbarBrand";
import Accordion from "react-bootstrap/Accordion";
import Card from "react-bootstrap/Card";
import AccordionToggle from 'react-bootstrap/AccordionToggle';
import Table from 'react-bootstrap/Table';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'

import styled from "styled-components";

import logo from "../images/pokepacksonline.png"

import CardListComponent from "./CardListComponent";

export default class PackListComponent extends React.Component{
    // consturctor(props){
    //     super(props);
    // }

    renderCards(cards) {
        return cards.map(card => <CardListComponent key={card.code} code={card.code} name={card.name} rarity={card.rarity} />)
    }

    render() {

        const Styles = styled.div`
            .nav-link{
                color: #FFFFFF !important;
            }

            .navbar{
                background-color: #272727 !important;
            }
        `

        const Logo = styled.img`
            height: auto;
            width: 15%;
        `

        //<Logo className="float-left" src={logo}>
        //<NavbarBrand style={{color: "#FFFFFF", fontSize: "2rem",}}></NavbarBrand>
        return (
            <Card>
                <Card.Header>
                <AccordionToggle as={Button} variant="link" eventKey={this.props.code}>
                    {this.props.name}  <Logo src={require("../images/packs/" + this.props.code + "/" + this.props.code + "Logo" +  ".jpg")}/>
                </AccordionToggle>
                </Card.Header>
                <Accordion.Collapse eventKey={this.props.code}>
                    <Card.Body>
                        <Table striped bordered hover>
                            <thead>
                                <tr>
                                    <th>Card Code</th>
                                    <th>Name</th>
                                    <th>Rarity</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.renderCards(this.props.cards)} 
                            </tbody>
                        </Table>
                    </Card.Body>
                </Accordion.Collapse>
            </Card>
        );
    }
}
